DROP TABLE IF EXISTS cip_liquidator_adm.nonexist_recovery_idempotency_new;

CREATE TABLE cip_liquidator_adm.nonexist_recovery_idempotency_new
(
    cod_nonexist_recovery_idempotency uuid NOT NULL,
    dat_creation timestamp without time zone NOT NULL DEFAULT now(),
    num_version bigint NOT NULL
) PARTITION BY RANGE (dat_creation)
WITH (
    OIDS = FALSE
)
TABLESPACE tsdcipliquidator01;

ALTER TABLE cip_liquidator_adm.nonexist_recovery_idempotency_new
    OWNER to cip_liquidator_adm;

COMMENT ON TABLE cip_liquidator_adm.nonexist_recovery_idempotency_new
    IS 'TABELA DE CONTROLE DE IDEMPOTENCIA PARA NAO PROCESSAMENTO DE RECUPERACOES';

COMMENT ON COLUMN cip_liquidator_adm.nonexist_recovery_idempotency_new.cod_nonexist_recovery_idempotency_new
    IS '[NOT_SECURITY_APPLY] [PK] Codigo de de idempotencia para processamento recuperacoes';

COMMENT ON COLUMN cip_liquidator_adm.nonexist_recovery_idempotency_new.dat_creation
    IS '[NOT_SECURITY_APPLY] Data de Criacao';

COMMENT ON COLUMN cip_liquidator_adm.nonexist_recovery_idempotency_new.num_version
    IS '[NOT_SECURITY_APPLY] Numero de Versao';

